article_content:
별한개도아까움
뚜껑 두개다깨져와서 교환신청해서 다시받았더니
또깨져옴 진짜 빡찜 더러워서 걍버렸음;

뚜껑이 하나가 깨져서 왔어요;
설마 내껀 안그럴줄 알앗는데
상품포장상태가 안좋아서 그런거같아요
비닐에 바닥에 박스하나 깔아서 보내다니요..;;
설마 알면서 깨진거 보낸건 아니겠지요?
배송하다가 깨졌어도 깨질민하게 한 포장같네요;;;

제가산거랑 덮개디자인이 틀리네요;;
제가산건 뚜껑도 완전히 잘안닫히고 쫌 들뜨네요;;
열때도 잘안열려서 많이 번거로움;;
이건 양쪽이라 괜찮아보이네요~

옷정리하려고샀어요~3번재구매했는데
요번에온건뚜껑하나가깨져서왔더라구여..
교환하기귀찮아깨진채로쓰고있습니다-,-;;

이사짐 정리용으로 잘 썼어요
근데 너무 많이 담거나 무거운거는 피하세요
바닥부분이 하얗게 변해서 깨질꺼 같아요;;

생각보다 엄청커서 놀랬습니다.
사이즈안보고 사진만보고 시켰는데;;
가격대비 사이즈는 최고네요

생각보다 크기 작구요 저렴해 보여요
그리고 내구성이 그렇게 탄탄한지는 잘 모르겠네요^^;

이사박스 모자른데 이사할때 그나마 잘 쓸 것 같네요
